import React from "react";

class Weather extends React.Component{
    render(){
        return(
            <div>
                <p>{this.props.temperature}</p>
                <p>{this.props.city}</p>
                {this.props.country}
                {this.props.humidity}
                {this.props.description}
            </div>
        );
    }
};

export default Weather;
